    <>
    <nav className = 'navbar'>
        <div className = 'navbar-container'>
            <Link to ="/" className='navbar-logo'>
                I farted <i className='fab fa-type3' /> 
            </Link>
            <div className='menu-icon'>
                <i className = {click ? 'fas fa-times' : 'fas fa-bars'} />
            </div>
            
        </div>
    </nav>
    </>
  )
}

export default Navbar;
